import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1>List of Illnesses</h1>
          <ul>
          	<li>Common cold</li>

            <li>Nausea</li>
            <li>Mental Health</li>

            <li>Migraines</li>

            <li>Digestive Disorders</li>
            <li>Eye health</li>
            <li>Food Poisoning</li>
            <li>Kidney Stones</li>
            <li>Dermotology</li>
            <li>Menstrual health</li>
            <li>Osteoporasis</li>
            <li>Sleep Disorders</li>
          </ul>
        </header>
      </div>
    );
  }
}

export default App;
